import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit,
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <label for={name}>Name</label>
      <input
        type="text"
        name={name}
        onChange={(e) => setName(e.target.value)}
      />

      labe
    </form>
  );
};
